import React, { useState } from 'react';
import './Recipes.css';

const RecipesCarousel = ({ title, recipes }) => {
  // States to manage the current set of recipes and enrollment info
  const [currentIndex, setCurrentIndex] = useState(0);
  const [enrolled, setEnrolled] = useState(null);  // Track the enrollment status for each item

  // Function to go to the next set of recipes
  const goToNext = () => {
    if (currentIndex + 4 < recipes.length) {
      setCurrentIndex(currentIndex + 4);
    }
  };

  // Function to go to the previous set of recipes
  const goToPrev = () => {
    if (currentIndex - 4 >= 0) {
      setCurrentIndex(currentIndex - 4);
    }
  };

  // Handle enroll action
  const handleEnroll = (index) => {
    const enrollmentDate = new Date().toLocaleDateString(); // Get today's date
    setEnrolled({ index, date: enrollmentDate });
  };

  // Render recipe items for the current set of images
  const renderRecipeItems = (items) => {
    return items.map((item, index) => (
      <div className="recipe-item" key={index}>
        <img src={item.image} alt={item.title} className="recipe-image" />
        <h4>{item.title}</h4>
        <p>{item.description}</p>
        <button 
          className="enroll-btn" 
          onClick={() => handleEnroll(currentIndex + index)} // Pass the current index of the item
        >
          Get Recipe
        </button>
        {enrolled && enrolled.index === currentIndex + index && (
          <p className="enrollment-message">
            Recipe Accessed Successfully.
          </p>
        )}
      </div>
    ));
  };

  return (
    <div className="recipe-section">
      <h3 className="recipe-title">{title}</h3>
      <div className="recipe-carousel">
        <button className="carousel-btn prev-btn" onClick={goToPrev}>
          ◄
        </button>
        <div className="carousel-content">
          <div className="recipe-row">
            {renderRecipeItems(recipes.slice(currentIndex, currentIndex + 4))}
          </div>
        </div>
        <button className="carousel-btn next-btn" onClick={goToNext}>
          ►
        </button>
      </div>
    </div>
  );
};

const Recipes = () => {
  const vegetarianRecipes = [
    { image: '/images/veg1.jpg', title: 'Vegetable Stir Fry', description: 'A quick and easy stir fry with seasonal vegetables and soy sauce.' },
    { image: '/images/veg2.jpg', title: 'Vegetable Curry', description: 'A rich and flavorful curry made with a mix of vegetables and spices.' },
    { image: '/images/veg3.jpg', title: 'Grilled Veggies', description: 'Healthy grilled vegetables tossed in olive oil and herbs.' },
    { image: '/images/veg4.jpg', title: 'Vegan Tacos', description: 'Delicious vegan tacos filled with seasoned vegetables and avocado.' },
    { image: '/images/veg5.jpg', title: 'Cauliflower Rice', description: 'A low-carb alternative to rice made from cauliflower.' },
    { image: '/images/veg6.jpg', title: 'Stuffed Bell Peppers', description: 'Bell peppers stuffed with quinoa, veggies, and topped with melted cheese.' },
    { image: '/images/veg7.jpg', title: 'Mushroom Risotto', description: 'A creamy risotto made with fresh mushrooms and Arborio rice.' },
    { image: '/images/veg8.jpg', title: 'Zucchini Noodles', description: 'Zucchini noodles tossed with a fresh tomato sauce and basil.' }
  ];

  const nonVegetarianRecipes = [
    { image: '/images/nonveg1.jpg', title: 'Grilled Chicken', description: 'Juicy grilled chicken marinated with herbs and spices.' },
    { image: '/images/nonveg2.jpg', title: 'Chicken Curry', description: 'A rich and creamy chicken curry made with aromatic spices.' },
    { image: '/images/nonveg3.jpg', title: 'Chicken Tacos', description: 'Tender chicken pieces in soft tortillas, topped with salsa and cheese.' },
    { image: '/images/nonveg4.jpg', title: 'Beef Stew', description: 'A hearty stew made with tender beef chunks, vegetables, and a savory broth.' },
    { image: '/images/nonveg5.jpg', title: 'Grilled Salmon', description: 'Salmon fillets grilled to perfection, served with lemon and herbs.' },
    { image: '/images/nonveg6.jpg', title: 'Pork Ribs', description: 'Succulent pork ribs with a smoky barbecue glaze.' },
    { image: '/images/nonveg7.jpg', title: 'Chicken Caesar Salad', description: 'A fresh Caesar salad topped with grilled chicken and parmesan cheese.' },
    { image: '/images/nonveg8.jpg', title: 'Shrimp Scampi', description: 'Shrimp cooked in garlic butter and served over pasta.' }
  ];

  return (
    <div>
      <RecipesCarousel title="Vegetarian Recipes" recipes={vegetarianRecipes} />
      <RecipesCarousel title="Non-Vegetarian Recipes" recipes={nonVegetarianRecipes} />
    </div>
  );
};

export default Recipes;
